import {useState} from "react";

export default function Form(){
    const [firstname, firstnameState] = useState("");
    const handleValue = (event) =>{
        firstnameState(firstname = event.target.value)
    }
    return (
        <div>
            Form
            <form>
                <input
                    onChange = {handleValue}
                    type = "text"
                    value = {firstname}
                >
                </input>
            </form>
        </div>
    );
}
